            ones++;
        }
    }
    if (n == 1) {
        cout << "NO\n";
        return;
    }
    if (sh) {
        cout << "n = " << n << "\n";
        cout << "asz " << a.size() << "\n";
        cout << "ones = " << ones << "\n";
        cout << "s = " << s << "\n";
    }
    ll odd = s - ones - (n - ones);
