const int MAXN = 1e5 + 5, MOD = 1e9 + 7;
string s;
int N;
set<char> isBad;
int dp[MAXN][2];

int Add(int x, int y){
    int z = x + y;
    if(z >= MOD)
        z -= MOD;
    return z;
}

int solve(int cost, bool isFirstChar)
{
    if(cost > N)
        return 0;
    if(cost == N)
        return 1;

    int& ret = dp[cost][isFirstChar];

    if(~ret)
        return ret;

    ret = 0;
    for(char i = 'a';i <= 'z';i++)
    {
        if(isFirstChar && isBad.find(i) != isBad.end())
            continue;
        ret = Add(ret, solve(cost + i, false));
    }
    return ret;
}


