class Compare {
public:
    bool operator()(pair<int, int> p1, pair<int, int> p2) {
        if (p1.first > p2.first) {
            return true;
        } else if (p1.first == p2.first
                   && p1.second < p2.second) {
            return true;
        }

        return false;
    }
};

signed main() {
    ios_base::sync_with_stdio(0);
    cin.tie(0);
    cout.tie(0);


    int cost, n, q, x;
    cin >> cost >> n >> q;

    vector<int> vec(n);
    for (int i = 0; i < n; i++)
        cin >> vec[i];

    priority_queue<pair<int, int>, vector<pair<int, int>>, Compare> myPq;
    unordered_map<int, bool> canBeUsed;
    vector<int> expensive;

    for (int i = 0; i < n; i++) {
        if (vec[i] > cost)
            expensive.push_back(vec[i]);
        canBeUsed[vec[i]] = true;
    }

    for (int i = 0; i < n; i++) {
        if (vec[i] <= cost) {
            int x = cost % vec[i];
            myPq.push({x, vec[i]});
            canBeUsed[vec[i]] = true;
        }
    }


    while (q--) {
        int qq;
        cin >> qq;

        if (qq == 1) {
            int ans = -1;
            if (!myPq.empty()) {
                while (!myPq.empty()) {
                    if (canBeUsed.count(myPq.top().second) && canBeUsed[myPq.top().second]) {
                        if (myPq.top().second <= cost) {
                            ans = myPq.top().second;
                            break;
                        } else
                            break;
                    } else
                        myPq.pop();

                }
            }
            cout << ans << endl;
        }
        if (qq == 2) {
            cin >> x;
            if (x > cost)
                expensive.push_back(x);
            else
                myPq.push({cost % x, x});
            canBeUsed[x] = true;
        }
        if (qq == 3) {
            cin >> x;

            if (canBeUsed.count(x) && canBeUsed[x]) {
                canBeUsed[x] = false;
                cout << "Deleted Successfully" << endl;
            } else {
                cout << "Can't Delete" << endl;
            }
        }
    }

    while (!myPq.empty()) {
        if (canBeUsed[myPq.top().second])
            cout << myPq.top().second << " ";
        myPq.pop();
    }

    sort(expensive.begin(), expensive.end());
    for (auto it: expensive) {
        if (canBeUsed.count(it) && canBeUsed[it])
            cout << it << " ";
    }
    cout << endl;


    return 0;
}

